// Struct definitions for the json coming in from ETA
type Routes struct {
	GetRoutes []struct {
		ID    int      `json:"id"`
		Name  string   `json:"name"`
		Stops []string `json:"stops"`
	} `json:"get_routes"`
}
type Stops struct {
	GetStops []struct {
		ID   int     `json:"id"`
		Name string  `json:"name"`
		Lat  float64 `json:"lat"`
		Lng  float64 `json:"lng"`
	} `json:"get_stops"`
}

type Vehicles struct {
	GetVehicles []struct {
		Equipmentid        string      `json:"equipmentID"`
		Lat                float64     `json:"lat"`
		Lng                float64     `json:"lng"`
		Routeid            int         `json:"routeID"`
		Nextstopid         interface{} `json:"nextStopID"`
		Schedulenumber     string      `json:"scheduleNumber"`
		Inservice          int         `json:"inService"`
		Minutestonextstops []Minutestonextstops
		//Minutestonextstops interface{}
		Onschedule  interface{} `json:"onSchedule"`
		Receivetime int64       `json:"receiveTime"`
	} `json:"get_vehicles"`
}

type Announcements struct {
	GetServiceAnnouncements []struct {
		Type string `json:"type"`
		Announcements []struct {
			End   string `json:"end"`
			Start string `json:"start"`
			Text  string `json:"text"`
		} `json:"announcements"`
	} `json:"get_service_announcements"`
}

type Minutestonextstops struct {
	StopID  int `json:"stopID"`
	Minutes int `json:"minutes"`
}

type BusInfo struct {
	Routeid     int         `json:"routeID"`
	Lat         float64     `json:"lat"`
	Lng         float64     `json:"lng"`
}
type StopInfo struct {
	ID                int              `json:"id"`
	Name              string           `json:"name"`
	NextBusTimesFinal map[string][]int `json:"nextBusTimes"`
	Lat               float64          `json:"lat"`
	Lng               float64          `json:"lng"`
}
type RouteInfo struct {
	ID    int    `json:"id"`
	Name  string `json:"name"`
	Stops []int  `json:"stops"`
}
type AnnouncementInfo struct {
	Announcements []string `json:"announcements"`
}
type FinalPackage struct {
	BusInfo   []BusInfo
	StopInfo  []StopInfo
	RouteInfo []RouteInfo
}
type FinalCreator struct {
	Routes Routes
	Stops  Stops
	Buses  Vehicles
	Announcements Announcements
}
type Client struct {
	Url string
}

// Lets make this into an interface so we can make great testable code
type Caller interface {
	httpCall() []byte
}
type Creator interface {
	CreateFinalJson() (*[]byte, error)
}

// Have some setters because why not :)
func (bi *BusInfo) SetBusInfo(Routeid int, Lat float64, Lng float64) {
	bi.Routeid = Routeid
	bi.Lat = Lat
	bi.Lng = Lng
}
func (ri *RouteInfo) SetRouteInfo(Id int, Name string, Stops []int) {
	ri.ID = Id
	ri.Name = Name
	ri.Stops = Stops
}
func (si *StopInfo) SetStopInfo(Id int, Name string, NextBusTimesFinal map[string][]int, Lat float64, Lng float64) {
	si.ID = Id
	si.Name = Name
	si.NextBusTimesFinal = NextBusTimesFinal
	si.Lat = Lat
	si.Lng = Lng
}
func (mtns Minutestonextstops) SetMinutesToNextStop(StopID int, Minutes int) {
	mtns.StopID = StopID
	mtns.Minutes = Minutes
}

