// Makes the call to the ETA jerks and returns the byte slice of json
func (c Client) httpCall() ([]byte, error) {
	//log.Println("Making call to: ", c.Url)
	req, err := http.NewRequest("GET", c.Url, nil)
	if err != nil {
		return nil, err
	}
	req.Header.Set("User-Agent", "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_1) AppleWebKit/600.1.25 (KHTML, like Gecko) Version/8.0 Safari/600.1.25")

	client := &http.Client{}
	resp, err := client.Do(req)
	if err != nil {
		return nil, err
	}
	defer resp.Body.Close()

	if resp.StatusCode != http.StatusOK {
		log.Println("Response did not return 200. Status received: ", resp.Status)
		log.Println("On this request: ", resp.Request)
		return nil, err
	}

	body, err1 := ioutil.ReadAll(resp.Body)
	if err1 != nil {
		return nil, err1
	}

	return body, nil
}

// Creates the final json to be served by the server
func (fc FinalCreator) CreateFinalJson() ([]byte, []byte, []byte, []byte, error) {

	var nextBusTimesStart []int
	var announcementString []string

	routeCollection := []RouteInfo{}
	stopCollection := []StopInfo{}
	busCollection := []BusInfo{}

	busInfo := BusInfo{}
	stopInfo := StopInfo{}
	routeInfo := RouteInfo{}

	for _, route := range fc.Routes.GetRoutes {
		var stopToInt []int
		for _, stop := range route.Stops {
			stopAsInt, _ := strconv.Atoi(stop)
			stopToInt = append(stopToInt, stopAsInt)
		}
		if strings.EqualFold(route.Name,"Will Vill - Brown Line"){
			route.Name = "Buff Bus"
		}
		routeInfo.SetRouteInfo(route.ID, route.Name, stopToInt)
		routeCollection = append(routeCollection, routeInfo)
	}

	//NEED to optomize this....  :(
	for _, stop := range fc.Stops.GetStops {
		mapIt := map[string][]int{}
		for _, bus := range fc.Buses.GetVehicles {

			if len(bus.Minutestonextstops) != 0 {
				for _, minute := range bus.Minutestonextstops {
					str := strconv.Itoa(bus.Routeid)
					if minute.StopID == stop.ID && minute.Minutes >= 0 {
						if _, ok := mapIt[str]; ok {
							mapIt[str] = append(mapIt[str], minute.Minutes)
						} else {
							nextBusTimesStart = append(nextBusTimesStart, minute.Minutes)
							mapIt[str] = nextBusTimesStart
							nextBusTimesStart = nil
						}
					}
				}
			}
		}

		for k := range mapIt {
			sort.Ints(mapIt[k])
		}

		if strings.EqualFold(stop.Name, "Euclid") {
			stop.Name = "UMC"
		}

		if !strings.EqualFold(stop.Name, "30th and Colorado E Bound") && !strings.EqualFold(stop.Name, "30th and Colorado WB") {
			stopInfo.SetStopInfo(stop.ID, stop.Name, mapIt, stop.Lat, stop.Lng)
			stopCollection = append(stopCollection, stopInfo)
		}
	}

	for _, bus := range fc.Buses.GetVehicles {
		if bus.Routeid != 777 {
		busInfo.SetBusInfo(bus.Routeid, bus.Lat, bus.Lng,)
		busCollection = append(busCollection, busInfo)
		}
	}

	for _, announcement := range fc.Announcements.GetServiceAnnouncements {
		for _,message := range announcement.Announcements {
			if message.Text != "" {
				announcementString = append(announcementString,message.Text)
			}
		}
	}

	announcementInfo := AnnouncementInfo{Announcements: announcementString}

	busJson, err := json.Marshal(busCollection)
	if err != nil {
		log.Println("Error Marshalling the JSON for the Audit", err)
		//return nil, nil, nil, err
	}
	stopJson, err := json.Marshal(stopCollection)
	if err != nil {
		log.Println("Error Marshalling the JSON for the Audit", err)
		//return nil, nil, nil, err
	}
	routeJson, err := json.Marshal(routeCollection)
	if err != nil {
		log.Println("Error Marshalling the JSON for the Audit", err)
		//return nil, nil, nil, err
	}
	announcementJson, err := json.Marshal(announcementInfo)
	if err != nil {
		log.Println("Error marshalling the JSOM for the Audit", err)
	}

	return busJson, stopJson, routeJson,announcementJson, nil
}
